						["check"] = "event",
						["custom"] = "function(allStates, event, triggerNumber, triggerStates)\n    if not triggerStates then\n        return false\n    end\n    \n    -- Affected units are stored globally so the numbers don't change if someone dies.\n    -- Reset when a new unit is affected, which means a new round of debuffs.\n    for _, state in pairs(triggerStates) do\n        local unit = state.unit\n        if unit and not aura_env.units[unit] then\n            wipe(aura_env.units)\n            -- Schedule report if enabled\n            if aura_env.config.report then\n                C_Timer.After(0.2, function()\n                        local units = {}\n                        for _, state in pairs(allStates) do\n                            units[state.stacks] = format(\"%s: %s\", state.stacks, UnitName(state.unit))\n                        end\n                        local report = table.concat(units, \", \")\n                        SendChatMessage(report, \"RAID\")\n                end)\n            end\n            break\n        end\n    end\n    \n    -- Add all affected units.\n    -- Sometimes, the new round of debuffs is applied a moment before the old one fades,\n    -- so we ignore units with less than two seconds left. Note, howver, that the units\n    -- aren't removed unless a new round has gone out.\n    local now = GetTime()\n    for _, state in pairs(triggerStates) do\n        local unit = state.unit\n        local remaining = state.expirationTime - GetTime()\n        if unit and remaining > 2 then \n            aura_env.units[unit] = true\n        end\n    end\n    \n    -- Sort by unit id (raidN) for consistent sorting amongst players\n    local unitIndexes = {}\n    for unit, _ in pairs(aura_env.units) do\n        -- Extract the raidN number to ensure raid1 < raid2 < raid10, unlike string sorting\n        tinsert(unitIndexes, tonumber(unit:sub(5)))\n    end\n    sort(unitIndexes)\n    \n    -- Clear existing states\n    for _, state in pairs(allStates) do\n        state.show = false\n        state.changed = true\n    end\n    \n    -- Create state using raidN as state-key to be compatible with the WA built-in trigger 1\n    for i, unitIndex in ipairs(unitIndexes) do\n        local unit = \"raid\" .. unitIndex\n        allStates[unit] = {\n            show = true,\n            changed = true,\n            unit = unit,\n            stacks = i,\n            glow = aura_env.config.glows[i],\n            showNumber = aura_env.config.show[i],\n            index = GetTime(),  -- https://github.com/WeakAuras/WeakAuras2/issues/4503\n        }\n    end\n    \n    return true\nend",
