						["custom"] = "function(allstates,_, _, subEvent, _, _, _, _, _, destGUID, destName, _, _,spellId, ...)\n    \n    local iFlesh = {\n        [66237] = true, -- Incinerate Flesh\n    }\n    local healAbsorb = {\n        [6] = 85000, -- 25man heroic\n        [4] = 60000, -- 25man normal\n        [5] = 40000, -- 10man heroic\n        [3] = 30000, -- 10man normal\n    }\n    local difficultyDura = {\n        [6] = 12, -- 25man heroic\n        [4] = 15, -- 25man normal\n        [5] = 12, -- 10man heroic\n        [3] = 15, -- 10man normal\n    }\n    \n    \n    if subEvent == \"SPELL_CAST_SUCCESS\" then\n        \n        if not iFlesh[spellId] then\n            return false\n        end\n        \n        local _, _, difficultyID, _, _, _, _ = GetInstanceInfo()\n        \n        allstates[spellId] = {\n            show = true,\n            changed = true,\n            progressType=\"static\",\n            duration = difficultyDura[difficultyID],\n            expirationTime = GetTime() + difficultyDura[difficultyID],\n            autoHide = true,      \n            shield = healAbsorb[difficultyID],\n        }\n        return true\n    end\n    \n    if subEvent == \"SPELL_HEAL_ABSORBED\" then\n        -- CRED Fojji / Strace\n        local state = allstates[spellId] \n        \n        if not state then\n            return false\n        end\n        \n        local vars = {...}\n        local numVars = #vars\n        local absorbedAmount = vars[numVars]\n        \n        state.shield = state.shield - absorbedAmount\n        state.changed = true\n        return true\n    end\n    \n    if subEvent == \"SPELL_AURA_REMOVED\" then\n        \n        local state = allstates[spellId] \n        \n        if not state then\n            return false\n        end\n        \n        state.show = false\n        state.changed = true\n        return true\n    end\n    \n    return false\nend",
