						["custom"] = "function(allstates,_, _, subEvent, _, _, _, _, _, destGUID, destName, _, _,spellId, ...)\n  \n  local shields = {\n    [65874] = true, -- Shield of Darkness\n    [65858] = true, -- Shield of Lights\n  }\n  local shieldValues = {\n    [6] = 1200000, -- 25man heroic\n    [4] = 700000, -- 25man normal\n    [5] = 300000, -- 10man heroic\n    [3] = 175000, -- 10man normal\n  }\n  \n  if subEvent == \"SPELL_CAST_SUCCESS\" then\n    if not shields[spellId] then\n      return false\n    end\n    \n    local _, _, difficultyID, _, _, _, _ = GetInstanceInfo()\n    \n    \n    allstates[spellId] = {\n      show = true,\n      changed = true,\n      progressType=\"static\",\n      value = shieldValues[difficultyID],\n      total = shieldValues[difficultyID],\n      autoHide = true,\n      duration = 15,\n      expirationTime = GetTime() + 15,\n      displayText = \"\",\n    }\n    \n    local SoD = 65874 -- Shield of Darkness\n    local SoL = 65858 -- Shield of Lights\n    \n    if spellId == SoL then\n      allstates[SoL].displayText = \"ATTACK LIGHT\"\n      allstates[SoL].changed = true\n    elseif spellId == SoD then\n      allstates[SoD].displayText = \"ATTACK DARK\"\n      allstates[SoD].changed = true\n    end\n    return true\n  end\n  \n  if subEvent == \"SPELL_ABSORBED\" then\n    -- CRED Fojji / Strace\n    local vars = {...}\n    local numVars = #vars\n    local shieldSpellId = vars[numVars - 3]\n    local absorbedAmount = vars[numVars]\n    local state = allstates[shieldSpellId]\n    \n    if not shields[shieldSpellId] then\n      return false\n    end\n    \n    if not state then\n      return false\n    end\n    \n    state.value = state.value - absorbedAmount\n    state.changed = true\n    \n    if (state.value <= 0) then      \n      state.displayText = \"INTERRUPT\"\n      state.changed = true\n      state.show = false\n    end\n    \n    return true\n  end\n  return false\nend",
